import React from "react";
import "../components/header.css"

function Header() {
  return (
    <div>
      <div class="sidenav">
        <a href="#about">About</a>
        <a href="#services">Services</a>
        <a href="#clients">Clients</a>
        <a href="#contact">Contact</a>
      </div>


    </div>
  );
}

export default Header;
